import React from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar/Navbar';
import Hero from './components/Hero/Hero';
import StudentSection from './components/StudentSection/StudentSection';
import Schedule from './components/Schedule/Schedule';
import Contact from './components/Contact/Contact';
import Footer from './components/Footer/Footer';

// Component cho trang chủ
const Home = () => {
  const navigate = useNavigate(); // Hook để điều hướng

  return (
    <>
      <Hero />
      {/* Student Section */}
      <StudentSection />
      {/* Hero Section */}
      <section className="hero">

      </section>
      {/* Schedule Section */}
      <section className="schedule">
        <h2>Lịch Học</h2>
        <div className="schedule-content">
          <p>Các lớp học được tổ chức linh hoạt, phù hợp với thời gian của học viên</p>
          <button 
            className="schedule-button" 
            onClick={() => navigate('/schedule')} // Sử dụng navigate để chuyển trang
          >
            Xem lịch học
          </button>
        </div>
      </section>

      {/* Contact Section */}
      <section className="contact">
        <h2>Liên Hệ Với Chúng Tôi</h2>
        <button 
          className="contact-button"
          onClick={() => navigate('/contact')} // Sử dụng navigate để chuyển trang
        >
          Liên hệ với chúng tôi
        </button>
      </section>
    </>
  );
};

function App() {
  return (
    <Router>
      <div className="app">
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/schedule" element={<Schedule />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
